INSERT INTO `news` (`news_id`, `title`, `headline`, `content`, `image`, `status`, `is_del`, `inserted_at`, `inserted_by`) VALUES
(1, 'Exchange Rates', 'Daily Foreign Exchange Rates', 'The exchange rate is the rate between two currencies at which one currency will be exchanged for another. It is also considered as the value of one country’s currency in terms of another currency; the price of selling one currency and buying another. Exchange rates between currencies are determined in the foreign exchange market.\r\n\r\nKindly Note- The exchange rates will be published by CBO daily, except for weekends and public holidays. Please note that these rates are for indication purposes only.', 'oman.jpg', 1, 0, '2017-02-07 19:17:49', 1),
(2, 'Governor of the Year', 'QCB Governor Named \"Governor of the Year\" for MENA Region 2016.', 'Emerging Markets Ltd. has presented HE Governor of Qatar Central Bank (QCB) Sheikh Abdullah bin Saud Al-Thani with the \"Governor of the Year\" award for the Middle East and North Africa (MENA) region for 2016, at a ceremony on the sidelines of the annual meetings of the International Monetary Fund (IMF). HE QCB Governor received the award in recognition of the policies and strategies adopted by Qatar Central Bank in the wake of the global financial crisis, and in addressing the challenges imposed by the declining oil prices.\r\nHis leadership and policies have contributed to achieving an effective coordination with the government and other regulatory agencies in supporting growth and maintaining financial stability in Qatar during those conditions.', 'qatar.JPG', 1, 0, '2017-02-07 19:20:54', 1),
(3, 'CBB Sukuk Al-Ijara subscribed', 'Manama, Bahrain –7th February 2017', 'This week’s BD 70 million issue of Government Treasury Bills has been subscribed by 114%.\r\n\r\nThe bills, carrying a maturity of 91 days, are issued by the CBB, on behalf of the Government of the Kingdom of Bahrain.  \r\n\r\nThe issue date of the bills is 7th December 2016 and the maturity date is 8th March 2017.\r\n\r\nThe weighted average rate of interest is 2.06%, compared to 2.05% for the previous issue on 30th November 2016.\r\n\r\n \r\n\r\nThe approximate average price for the issue was 99.482% with the lowest accepted price being 99.457%.\r\n\r\n \r\n\r\nThis is issue No. 1629 (ISIN BH0003666904) of Government Treasury Bills. With this, the total outstanding value of Government Treasury Bills is BD 1.785 billion.', 'behrain2.jpg', 1, 0, '2017-02-07 20:21:49', 1),
(4, 'Saudi Arabia', 'Saudi central bank announces change in name', 'JEDDAH: The Saudi Arabian Monetary Agency announced on Sunday that its name has been changed to Saudi Arabian Monetary Authority.\r\nSAMA, the bank\'s acronym, remains unchanged.\r\n\"All existing agreements, obligations and contracts under the previous name of SAMA will continue to remain in force,\" the bank said in a statement.\r\nIt said the change takes effect \"from the date of this announcement.\"\r\nEstablished in 1952, SAMA is currently headed by Dr. Ahmed Abdulkarim Alkholifey, who assumed office as governor on May 8, 2016.', 'saudi.jpg', 1, 0, '2017-02-07 20:02:06', 1),
(5, 'silversolve', 'silversolve aniversery', 'sakd;as jkd asl jld als ld las l dl jsa jsahd ad askdksa khdk sakhdhahdahs hdajks dhakjh sdkh ajkhsdhajkhs dkhajkhs dhajkhsdkhakjhsdkhaks hd hajksd jk lksa jl jsa;l j;lsf j;las jf;l jd;lf js;ld jf;l j dsjlkjdfs; ldsjk fjlk hk h ffjk hdfslkjsahdfjlkhsalkj hjlksad hlkf hs hfjlksad hjlkf hsalkdf hksa', 'Penguins.jpg', 1, 0, '2017-02-14 20:01:10', 1),
(6, 'Pagination', 'Basic Pagination', 'Simple pagination inspired by Rdio, great for apps and search results. The large block is hard to miss, easily scalable, and provides large click areas.', 'Chrysanthemum.jpg', 1, 0, '2017-02-08 18:18:28', 1),
(7, 'this is my test news', 'test head line', 'Content itself is what the end-user derives value from. Thus, \"content\" can refer to the information provided through the medium, the way in which the information was presented, as well as the added features included in the medium in which that information was delivered. The medium, however, provides little to no value to the end-user without the information and experiences that make up the content. Communication theory philosopher Marshall McLuhan famously coined the phrase, \"The medium is the message.\"[3] In the case of content, the channel through which information is delivered, the \"medium\", affects how the end user perceives content, the \"message\".\r\n\r\nThe author, producer, or publisher of an original source of information or experiences may or may not be directly responsible for the entire value that they attain as content in a specific context. For example, part of an original article (such as a headline from a news story) may be rendered on another web page displaying the results of a user\'s search engine query grouped with headlines from other news publications and related advertisements. The value that the original headline has in this group of query results from the search engine as a medium may be very different from the value that it had as message content in its original article.\r\n\r\nContent also leads to influencing other people in creating their own content, sometimes in a way that the original author did not or could not plan or imagine. This feature, adding the option of user innovation in a medium, means that users can develop their own content from existing content.', 'Desert.jpg', 1, 0, '2017-07-12 10:58:00', 1);
